<template>
  <div id="heat-rank"></div>
</template>

<script>
import * as echarts from "echarts";
import { request } from "@/network/request";
export default {
  computed: {
    stateId() {
      return this.$store.state.stateId;
    },
    option() {
      return {
        tooltip: {},
        xAxis: {
          splitLine: { show: false },
          offset: 10,
          axisLine: {
            lineStyle: {
              color: "#999",
            },
          },
          axisLabel: {
            margin: 10,
          },
        },
        yAxis: {
          data: this.uni,
          inverse: true,
          axisTick: { show: false },
          axisLine: { show: false },
          axisLabel: {
            margin: 10,
            color: "#999",
            fontSize: 15,
          },
        },
        grid: {
          top: "center",
          height: 200,
          left: 70,
          right: 100,
        },
        series: [
          {
            // current data
            type: "pictorialBar",
            symbol:
              "image://data:image/png;base64," +
              "" +
              "" +
              "",
            //symbol: 'image://data:image/png;base64,'+
            //'',
            symbolRepeat: "fixed",
            symbolMargin: "5%",
            symbolClip: true,
            symbolSize: 30,
            symbolBoundingData: 50000000,
            data: this.heat,
            markLine: {
              symbol: "none",
              label: {
                formatter: "max: {c}",
                position: "start",
              },
              lineStyle: {
                color: "green",
                type: "dotted",
                opacity: 0.2,
                width: 2,
              },
              data: [
                {
                  type: "max",
                },
              ],
            },
            z: 10,
          },
        ],
      };
    },
    data() {
      return {
        uni: ["uni", "uni", "uni", "uni", "uni"],
        heat: [100, 100, 100, 100, 0],
        chart: null,
      };
    },
  },
  methods: {
    initCharts() {
      request({
        method: "GET",
        url: "/college/search_popularity",
      }).then((res) => {
        const top5 = Object.entries(res.data)
          .sort((a, b) => b[1] - a[1])
          .slice(0, 5);
        this.uni = top5.map((x) => x[0]);
        this.heat = top5.map((x) => x[1]);

        if (this.chart != null) {
          this.chart.dispose();
        }
        const chart = echarts.init(document.getElementById("heat-rank"));
        const option = this.option;
        chart.setOption(option);
        this.chart = chart;
      });
    },
  },
  watch: {
    stateId(n, o) {
      this.initCharts();
    },
  },
};
</script>

<style scoped>
#heat-rank {
  width: 100%;
  height: 100%;
}
</style>
